        "comments": "KommentarerKursrepresentantens kommentarerAv enka\u0308tsvaren att do\u0308ma a\u0308r studenter generellt sa\u0308tt no\u0308jda med kursen. Undervisningen anses vara entusiasmerande och la\u0308rarna har lyckats sa\u0308rskilt va\u0308l i att go\u0308ra a\u0308mnet intressant. No\u0308jd konsensus ga\u0308ller a\u0308ven allma\u0308nna fa\u0308rdigheter, kursens ma\u030alsa\u0308ttning samt examination, da\u0308r de flesta studenter upplever att muntlig tenta a\u0308r ett gott sa\u0308tt att examinera kunskap i a\u0308mnet.Missno\u0308je ra\u030ader da\u0308remot ga\u0308llande kursens arbetsbelastning. Ho\u0308g press tillsammans med stor volym pa\u030a kurslitteratur resulterar i allt fo\u0308r tung arbetsbo\u0308rda. Litteraturen bo\u0308r ses o\u0308ver och artiklar/avsnitt bo\u0308r strykas. L\u00e4sanvisningarna till materialet b\u00f6r inneh\u00e5lla f\u00f6rtydligande \u00f6ver vad som \u00e4r viktigt och del av examination, vad som \u00e4r f\u00f6rberedande och kan underl\u00e4tta f\u00f6r vidare l\u00e4sning eller vad som \u00e4r utanf\u00f6r kursen.Under de senare delarna av kursen, som inneh\u00e5ller mer organisatoriska delar av konfigurationshantering, hade det varit bra med konkreta exempel som till exempel ett rollspel \u00f6ver hur ett CCB-m\u00f6te g\u00e5r till.Kursl\u00e4rarens kommentererI am very happy that the course, like previous years, get fairly good ratings from the students - though the ratings from my own evaluation questionnaire (with 53 out of 53 students answering) in general were even more positive.The aspect of good teaching that scored lowest (+16) was \"helpful feedback\". Given that the resources for courses have continuously been cut down on from \"higher up\", I have had less resources to provide feedback. I have tried to counter this by introducing Student Peer Assessment on two deliveries - reducing the workload from other things by the 75-105 minutes students are supposed to spend assessing. For the students it should be a win-win situation - both learning from the feedback they get and from reflecting on what they assess. Apparently students only focus on the feedback they get from \"the teaching staff\" - I will try to enlighten them next year.Clear Goals and Standards also gets a lower rating (+25) than I would have expected. The first (and the last) lecture gives the overall learning goals of the course, each lecture (and other activities) has a slide with the specific learning goals for that session, the course web pages describe the learning goals for each single activity, and the course plan specifies the overall learning goals. But if you ignore that, then it is difficult to know what is expected from you.The workload of the course is a returning concern. From a detailled inquiry I made 6-7 years ago it turned out that no student spent more than 200 hours, which is required for 7.5 ECTS, on the course. So my conclusion is that the high workload is a subjective feeling more than an objective fact - or maybe students compare with what is required on other courses? The complaint about too much reading I cannot take serious - this is a university, you are supposed to be able to read papers (and if you have read the previous CEQs - which are linked to from the course page - it should not come as a surprise). For the workload I have always been painfully aware that for each new activity I add to the course, I will have to take away an equivalent workload somewhere else. For the papers, I constantly try to see if I can find better reading material - but then again, if it becomes 15 hours easier to read the papers, it just means that I can add 15 hours of new activities ;-)CEQ-enk\u00e4ten fylldes iWebbenk\u00e4ter har anv\u00e4nts p\u00e5 denna kurs."
