        "comments": "Kursrepresentantens kommentarerKommentarer har ej inkommet f\u00f6re utsatt tidKursl\u00e4rarens kommentererThere has been an overall improvement in the CEQ results this year. Students seem to appreciate the new project, and we will continue with the same project format next year. The two main areas of improvement that can be seen in the CEQ responses are \"appropriate assessment\" and \"appropriate workload\". In terms of the workload, I don't think it is excessive for a course at this level: a project, an exam, and five readings with maximum 500 word written responses. However, next year I plan to replace some of the readings as they are quite long and difficult for students to understand - it's hard to find papers that are short, well-written, significant in the field, and easy to follow for someone not familiar with the area. But I think the reading tasks are valuable as they give students practice reading, analysing, and writing about scientific papers, which they will need to do in their degree projects.Regarding the assessment, an extra question was added to ask about the project specifically, and the response to this question was positive, which suggests the main issue is with the exam. From my experience marking the exam, as well as talking to students, it seems that many students do not have a clear idea about what is expected in their exam responses to get a good mark. Students often memorise material to an unnecessary extent. One way to help with this could be to have more assessment earlier in the course (even if not for credit) to allow students to practice the types of questions in the exams, and to see how they will be marked. This, however, has to be balanced with the time required for teachers to do the marking. Another option may be to move to an open-book exam, or allow students to take some notes into the exam.There were also some comments about unclear goals in the course. To some extent this is deliberate. The project scenarios were intended to reflect real-life scenarios, with some stated goals, but a large part of the project task lies in researching, defining, and specifying the problem. This is something that students had difficulty with, however this was expected and one of the main aims of the project is to give students experience in solving these types of open-ended problems. Since this was the first year running the new project, we now have a better idea of where the difficulties for students are and can improve the instructions and other material for next year, but the overall nature of the task will be the same.CEQ-enk\u00e4ten fylldes iWebbenk\u00e4ter har anv\u00e4nts p\u00e5 denna kurs."
